{"bio": {"type": "/type/text", "value": ""I studied physics (a long time ago), then trained as a science and maths teacher. After that, I worked at London’s Science Museum in the Education Unit – and in the museum’s flagship interactive gallery, Launch Pad.

I left the museum in 1991 to write science and technology books and to write and perform science shows in museums, libraries and schools. Recently, I worked for two years on the development of science television programs for BBC Scotland."
Source: http://explaining-science.co.uk/"}, "name": "Jack Challoner", "created": {"type": "/type/datetime", "value": "2008-04-01T03:28:50.625462"}, "personal_name": "Jack Challoner", "photos": [7395970], "last_modified": {"type": "/type/datetime", "value": "2016-02-11T14:07:59.964899"}, "latest_revision": 4, "key": "/authors/OL30219A", "type": {"key": "/type/author"}, "revision": 4}

{"bio": {"type": "/type/text", "value": "Peter Menzel is a photographer known for his coverage of international feature stories on science and the environment. His award-winning photographs have been published in Life, National Geographic, Smithsonian, the New York Times Magazine, Time, Stern, GEO, and Le Figaro.

*From [MIT Press][1]* 


  [1]: http://mitpress.mit.edu/catalog/item/default.asp?ttype=2&tid=4109"}, "name": "Peter Menzel", "created": {"type": "/type/datetime", "value": "2008-04-01T03:28:50.625462"}, "personal_name": "Peter Menzel", "last_modified": {"type": "/type/datetime", "value": "2017-03-31T17:00:09.536796"}, "latest_revision": 4, "key": "/authors/OL217152A", "birth_date": "1948", "remote_ids": {"viaf": "51814206", "wikidata": "Q5984663"}, "type": {"key": "/type/author"}, "revision": 4}

{"bio": {"type": "/type/text", "value": "A philosopher and scientist, Marvin Minsky is universally regarded as one of the world's leading authorities in the field of artificial intelligence, having made fundamental contributions in the sectors of robotics and computer-aided learning technologies. In recent years he has worked chiefly on imparting to machines the human capacity for common-sense reasoning. His book Society of Mind is considered a basic text for exploring intellectual structure and function, and for understanding the diversity of the mechanisms interacting in intelligence and thought. Minsky received his BA and PhD in mathematics from Harvard and Princeton, respectively. In 1951 he built the SNARC, the first neural network simulator. His other inventions include mechanical hands and other robotic devices, the confocal scanning microscope, the "Muse" synthesizer for musical variations (with E. Fredkin), and the first LOGO "turtle" (with S. Papert). 
[(source)][1]


  [1]: https://www.media.mit.edu/people/minsky"}, "name": "Marvin Minsky", "personal_name": "Marvin Lee Minsky", "created": {"type": "/type/datetime", "value": "2008-04-01T03:28:50.625462"}, "alternate_names": ["Marvin Lee Minsky", "Marvin L. Minsky"], "photos": [7354632], "last_modified": {"type": "/type/datetime", "value": "2015-07-04T13:55:35.357758"}, "latest_revision": 5, "key": "/authors/OL1076682A", "birth_date": "1927", "type": {"key": "/type/author"}, "revision": 5}

{"bio": {"type": "/type/text", "value": "Faith D’Aluisio is a former television news producer. Her documentary and news series pieces have won regional and national awards from the Headlines Foundation, United Press International, Associated Press, and the Radio-Television News Directors Association.

*From [MIT Press][1]*


